export async function GetStocks(setStocks){
    const response = fetch('/stocks');
    response.then(async (data) => {
        const r = await data.json();
        console.log(r);
        setStocks(r);
        setTimeout(async () => {
            await GetStocks(setStocks);
        }, 300);
    });
}
